CREATE TABLE IF NOT EXISTS `ilses` (
  `ID` int(11) NOT NULL DEFAULT '0',
  `RunwayID` int(11) DEFAULT '0',
  `Freq` int(11) DEFAULT '0',
  `GsAngle` float DEFAULT '0',
  `Latitude` double DEFAULT '0',
  `Longtitude` double DEFAULT '0',
  `Category` tinyint(4) DEFAULT '0',
  `Ident` varchar(5) DEFAULT NULL,
  `LocCourse` float DEFAULT '0',
  `CrossingHeight` tinyint(4) DEFAULT '0',
  `HasDme` tinyint(1) DEFAULT '0',
  `Elevation` int(11) DEFAULT '0',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

